commits.content:
* {
    box-sizing: border-box;
}
header {
    display: flex;
    justify-content: space-between;
}
nav a {
text-decoration: none;
color: white;
} 
body {
    background-image: url(waecback.JPG);

}
nav a img {
    height: 50px;
    padding: 10px;
}
nav b {
    max-width: 100%;
    width: 50px;
    margin-inline-start: 10px;
    font-size: 12px;
    padding-left: 10px;
}
div h1{
color: white;
margin-top: 100px;
text-align: center;
font-family: Georgia, 'Times New Roman', Times, serif;
}
div p {
    text-align: center;
    color: whitesmoke;
}
div h2 {
    text-align: center;
    color: whitesmoke;
    font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
}
div button {
    padding: 10px;
    background: rgb(227, 227, 19);
    border: none;
    margin: 10px;
    border-radius: 10px;
    color: blueviolet;
}
